
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Lazreth's Title Generator</title>
  <style>
    body {
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
      background-color: #1e1e2f;
      color: #f0e6d2;
      text-align: center;
      padding: 30px;
    }
    button {
      font-size: 1.2em;
      padding: 10px 20px;
      margin: 10px;
      border: none;
      background-color: #8b5cf6;
      color: white;
      border-radius: 8px;
      cursor: pointer;
    }
    #titleList {
      font-size: 1.5em;
      margin-bottom: 20px;
      color: #f9f2dc;
      font-family: 'Georgia', serif;
      text-shadow: 1px 1px 3px #000;
    }
    .image-title-card {
      position: relative;
      width: 100%;
      max-width: 600px;
      margin: 30px auto;
      border-radius: 12px;
      overflow: hidden;
      box-shadow: 0 0 10px #000;
    }
    .image-title-card img {
      width: 100%;
      height: auto;
      display: block;
    }
    .image-title-text {
      position: absolute;
      bottom: 0;
      background: rgba(30, 30, 30, 0.7);
      color: #f9f2dc;
      width: 100%;
      box-sizing: border-box;
      padding: 20px 25px 20px 25px;
      font-size: 1.3em;
      font-family: 'Georgia', serif;
      text-shadow: 1px 1px 4px #000;
    }
  </style>
</head>

  <script>
    function roll1d4plus2() {
      return Math.floor(Math.random() * 4) + 3;
    }

    function playLaugh() {
      const laugh = document.getElementById('laughAudio');
      laugh.currentTime = 0;
      laugh.play().catch(e => console.warn('Audio playback error:', e));
    }

    function generateTitles() {
      const count = roll1d4plus2();
      const selected = [];
      const usedIndices = new Set();

      while (selected.length < count) {
        const index = Math.floor(Math.random() * titles.length);
        if (!usedIndices.has(index)) {
          selected.push(titles[index]);
          usedIndices.add(index);
        }
      }

      const formatted = selected.map(t => {
        return (t.toLowerCase().startsWith('the ') ? t : 'the ' + t);
      }).join(', ');

      const output = 'Lazreth, ' + formatted;
      document.getElementById('titleList').innerText = output;

      // Clear previous cards
      document.getElementById('titleCardArea').innerHTML = "";

      playLaugh();
    }

    function createTitleCard() {
      const text = document.getElementById('titleList').innerText;
      if (!text || !text.startsWith('Lazreth')) return;

      const card = document.createElement('div');
